description:
The polygon shapefile shows the extent of the oil spill as of May 10, 2010
The data for this came via DHS's Daily Remote Sensing Situation Report of 16th May, 2010 produced in response to BP's oil spill in the Gulf of Mexico (GOM).
Look elsewhere on Finder! for oil spill data, use key words &quot;bp oil spill&quot;, &quot;oil spill&quot;, BP, &quot;Gulf Oil Spill&quot;
